(1, 1, '2018-02-06 17:33:57', '2018-02-06 14:33:57', '[:en]Добро пожаловать в WordPress. Это ваша первая запись. Отредактируйте или удалите её, затем пишите![:]', '[:en]Привет, мир![:]', '', 'trash', 'open', 'open', '', '%d0%bf%d1%80%d0%b8%d0%b2%d0%b5%d1%82-%d0%bc%d0%b8%d1%80__trashed', '', '', '2018-02-08 16:17:24', '2018-02-08 13:17:24', '', 0, 'http://localhost/sbusiness/?p=1', 0, 'post', '', 1),
(2, 1, '2018-02-06 17:33:57', '2018-02-06 14:33:57', '[:en]Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице &laquo;Детали&raquo; владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:\n\n<blockquote>Привет! Днём я курьер, а вечером &#8212; подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</blockquote>\n\n...или так:\n\n<blockquote>Компания &laquo;Штучки XYZ&raquo; была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</blockquote>\n\nПерейдите <a href="http://localhost/sbusiness/wp-admin/">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов![:]', '[:en]Пример страницы[:]', '', 'trash', 'closed', 'open', '', 'sample-page__trashed', '', '', '2018-02-06 18:02:58', '2018-02-06 15:02:58', '', 0, 'http://localhost/sbusiness/?page_id=2', 0, 'page', '', 0),
